import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import { Link } from 'react-router-dom';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Home from './Routes/Home'; // Importa el componente Home
import Detail from './Routes/Detail'; // Importa el componente Detail
import Contact from './Routes/Contact'; // Importa el componente Contact
import Favs from './Routes/Favs'; // Importa el componente Favs
import React from 'react';
import Routes from './Routes';



function App() {
  return (
    <Router>
      <div className="App">
          <Navbar/>
          <Routes>
          <Route exact path="/" element={<Home />} />
          <Route path="/Detail" element={<Detail />} />
          <Route path="/Contact" element={<Contact />} />
          <Route path="/Favs" element={<Favs />} />
          </Routes>
          <Footer/>
      </div>
      </Router>
  );
}

export default App;
